import React from 'react';
import '../App.css';

export default class NameTable extends React.Component {

  render

  render(){
    return (
      <div className="name-table">
        <table>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Gender</th>
            <th>Region</th>
          </tr>
        </table>
      </div>
    )
  }
}
